import React, {Component} from 'react';
import Header from './header';
import Call_action from './call_action';
import Footer from './footer';

class Home extends Component{
    render(){
       
        return(
            <div className="about_page">
                <div className="wellcom_banner">
                    <Header />
                </div>
                <div className="about_wrap">
                    <div className="container">
                        <h3>Trading rules</h3>
                        <p>Newdex is a decentralized exchange based on EOS. Buyers and sellers entrust orders in the trading market, and determine the transaction price of both parties according to the principle of price priority and facilitate the transaction.</p>
                        <p>If the price is the same, the priority is decided according to the time of application, and the person who makes the application first will facilitate the transaction.</p>
                    </div>
                </div>
                <Call_action />
                <Footer />
            </div>
        )
    }
}

export default Home;
